letter-spacing: -0.333333px;
color: #FFFFFF;
`;

export const Txt = styled.Text`
font-family: 'Roboto';
font-style: normal;
font-weight: 300;
font-size: 18px;
line-height: 21px;
letter-spacing: -0.333333px;
color: #000000;

